-- Verificar resultado
SELECT COUNT(*) as total_lentes FROM lens_catalog.lentes;

-- Ver distribuição por marca
SELECT 
    m.nome as marca,
    COUNT(*) as total
FROM lens_catalog.lentes l
LEFT JOIN lens_catalog.marcas m ON l.marca_id = m.id
GROUP BY m.nome
ORDER BY total DESC;

-- Ver distribuição por fornecedor
SELECT 
    f.nome as fornecedor,
    COUNT(*) as total
FROM lens_catalog.lentes l
LEFT JOIN pessoas.fornecedores f ON l.fornecedor_id = f.id
GROUP BY f.nome
ORDER BY total DESC;

